import React from 'react'
import {Box, Text} from 'native-base'

import AppButton from '../Components/AppButton'


function LoginSreen() {
  return (
    // <div>LoginSreen</div>
    <Box>
        <Text>
        LoginScreen
        </Text>
        <AppButton color="#fff696" title="ini Kodok" />
    </Box>
  )
}

export default LoginSreen
